Legend for Normalization 3NF
There are no code fence blocks or other standard for rendering entities in the three stages to third-normal-form. However, in Markdown, you can add styles to indicate such things as primary keys and foreign keys.
Legend
his legend is a guide to reading and interpreting the table listings under 0NF through 3NF.

TableName: - Table names will be bolded and end with a colon. (e.g.: **TableName:**)
(Column, Names) - Column names for a table will be enclosed in (rounded parenthesis).
PrimaryKeyFields - Primary key fields will be bold and inside a box. (e.g: PrimaryKeyFields)
ForeignKeyFields - Foreign key fields will be a wavy underline in italic and green. (e.g.: ForeignKeyFields)
{Repeating Groups} - Groups of repeating fields will be identified in 0NF stage, and will be enclosed in orange curly braces. (e.g.: {Repeating, Group, Fields})

To make this legend appear correctly in MarkDown, include the following style markup at the end of your markdown file:

.pk {
    font-weight: bold;
    display: inline-block;
    border: solid thin blue;
    padding: 0 1px;
}
.fk {
    color: green;
    font-style: italic;
    text-decoration: wavy underline green;    
}
.gr {
    color: darkorange;
    font-size: 1.2em;
    font-weight: bold;
}


Demo
The following demo illustrates a 1st/2nd normal form stage development for the concept of a Purchase Order.
0NF
After performing Zero-Normal Form, a single table was generated: Order.
Order:    (OrderNumber, CustomerNumber, FirstName, LastName, Address, City, Province, PostalCode, Phone, Date, {ItemNumber, Description, Quantity, CurrentPrice, SellingPrice, Amount}, Subtotal, GST, Total)
